import React, { Component } from 'react';
// import UserItem from './UserItem/';


class Users extends Component {
    constructor() {
        super();

        this.state = {
            users: [
                {
                    id: '1'
                },
                {
                    id: '2'
                },
                {
                    id: '3'
                }
            ]
        }
    }



    render() {
        return (
            <div>
                {this.state.users.map(user => {
                    console.log(user)
                })}
            </div>
        )
    }
}

export default Users;
